class QuantumVolumeBenchmark:
    def time_simulator_transpile(self, _, __):
        transpile(self.circuit, self.sim_backend)

    def setup(self, width, depth):
        random_seed = np.random.seed(10)
        if NO_KAK:
            self.circuit = build_qv_model_circuit(
